@Override public YarnProtos.StringStringMapProto next() {
  String key = keyIter.next();
  String value = containerAttributes.get(key);

  if (value == null) {
    value = "";
  }

  return YarnProtos.StringStringMapProto.newBuilder().setKey(key)
      .setValue((value)).build();
}
